import React from 'react';
import Card from './Card';


function Cardwrapper(){
    const cls = { className: 'mt-3 cs' }
    return (
        <div className="col col-md-6 ml-5">
            <Card cal={cls}/>
        </div>
    )
}

export default Cardwrapper;
